mally, Apple offers a one-month free trial for the service, so you should definitely grab this much better offer before it\'s gone.</p><p dir=\"ltr\" style=\"outline: 0px; margin-right: 0px; margin-bottom: 1.3rem; margin-left: 0px; padding: 0px; font-size: 16px;\" .sfnstext-regular\",=\"\" blinkmacsystemfont,=\"\" \"san=\"\" francisco\",=\"\" roboto,=\"\" \"segoe=\"\" ui\",=\"\" oxygen,=\"\" ubuntu,=\"\" cantarell,=\"\" \"fira=\"\" sans\",=\"\" \"droid=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" \"lucida=\"\" grande\",=\"\" sans-serif;\"=\"\">The Apple Arcade library has expanded to include more than 200 games. Though Apple has occasionally removed games from the library, the list of titles has grown far more than it has been pared down. The library is quite good, with a great mix of exclusives, ports of beloved games, and remastered and updated versions of mobile classics.</p><p dir=\"ltr\" style=\"outline: 0px; margin-right: 0px; margin-bottom: 1.3rem; margin-left: 0px; padding: 0px; font-size: 16px;\" .sfnstext-regular\",=\"\" blinkmacsystemfont,=\"\" \"san=\"\" francisco\",=\"\" roboto,=\"\" \"segoe=\"\" ui\",=\"\" oxygen,=\"\" ubuntu,=\"\" cantarell,=\"\" \"fira=\"\" sans\",=\"\" \"droid=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" \"lucida=\"\" grande\",=\"\" sans-serif;\"=\"\">Over the past several months, a handful of notable games have been added to the lineup. Most recently,&nbsp;<span style=\"outline-color: initial; outline-style: initial;\">Pocket Card Jockey: Ride On galloped onto iOS</span>&nbsp;as an Apple Arcade exclusive. A port of the Nintendo 3DS cult hit, Pocket Card Jockey was developed by Game Freak and revolves around horse racing and solitaire. Last month, Dead Cells+, one of the best roguelike action games around, launched on Apple Arcade, joining other recent standouts such as Shovel Knight Dig and NBA 2K23 Arcade Edition.</p><p><br></p><p><br></p><p>\"Free Apple Arcade games\" \"Apple Arcade free subscription\" \"Apple Arcade free access\" \"Apple Arcade no cost\" \"Apple Arcade free play\" \"Apple Arcade free membership\" \"Apple Arcade no payment\" \"Apple Arcade without charge\" \"Apple Arcade without cost\"<br></p>","7-9853840-multiip_2021_3840x2160_1.jpg_1920x700_q100_crop-scale_optimize_subsampling-2.webp","2023-01-24 17:04:58","60","get-a-free-apple-arcade-subscription-for-a-limited-time","1"),
("8","Xbox Game Pass Is Losing Four More Games Very Soon","<p style=\"outline: 0px; margin-right: 0px; margin-bottom: 1.3rem; margin-left: 0px; padding: 0px; font-size: 16px; font-family: -apple-system, \" .sfnstext-regular\",=\"\" \"system-ui\",=\"\" \"san=\"\" francisco\",=\"\" roboto,=\"\" \"segoe=\"\" ui\",=\"\" oxygen,=\"\" ubuntu,=\"\" cantarell,=\"\" \"fira=\"\" sans\",=\"\" \"droid=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" \"lucida=\"\" grande\",=\"\" sans-serif;\"=\"\"><span style=\"font-size: 16px;\">﻿</span>As it does on a regular basis, Microsoft is removing more titles from Xbox Game Pass in the near future. At least four titles are leaving the program on January 31, according to a notification that popped up in the Xbox Game Pass app seen by GameSpot.</p><p style=\"outline: 0px; margin-right: 0px; margin-bottom: 1.3rem; margin-left: 0px; padding: 0px; font-size: 16px; font-family: -apple-system, \" .sfnstext-regular\",=\"\" \"system-ui\",=\"\" \"san=\"\" francisco\",=\"\" roboto,=\"\" \"segoe=\"\" ui\",=\"\" oxygen,=\"\" ubuntu,=\"\" cantarell,=\"\" \"fira=\"\" sans\",=\"\" \"droid=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" \"lucida=\"\" grande\",=\"\" sans-serif;\"=\"\">The four games leaving on January 31 include Telling Lies, Donut County, Worms W.M.D., and Taiko no Tatsujin: The Drum Master. Microsoft has yet to publish an official post about the newest removals from Game Pass, but news usually breaks first from the app. Keep checking back for more.</p><p style=\"outline: 0px; margin-right: 0px; margin-bottom: 1.3rem; margin-left: 0px; padding: 0px; font-size: 16px; font-family: -apple-system, \" .sfnstext-regular\",=\"\" \"system-ui\",=\"\" \"san=\"\" francisco\",=\"\" roboto,=\"\" \"segoe=\"\" ui\",=\"\" oxygen,=\"\" ubuntu,=\"\" cantarell,=\"\" \"fira=\"\" sans\",=\"\" \"droid=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" \"lucida=\"\" grande\",=\"\" sans-serif;\"=\"\">As usual, Game Pass subscribers can save 20% on titles when buying them outright, so that\'s a silver lining should fans want to keep playing after the removal date.</p><p style=\"outline: 0px; margin-right: 0px; margin-bottom: 1.3rem; margin-left: 0px; padding: 0px; font-size: 16px; font-family: -apple-system, \" .sfnstext-regular\",=\"\" \"system-ui\",=\"\" \"san=\"\" francisco\",=\"\" roboto,=\"\" \"segoe=\"\" ui\",=\"\" oxygen,=\"\" ubuntu,=\"\" cantarell,=\"\" \"fira=\"\" sans\",=\"\" \"droid=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" \"lucida=\"\" grande\",=\"\" sans-serif;\"=\"\">This is the second wave of removals for Game Pass in January. On January 15,&nbsp;<span style=\"outline-color: initial; outline-style: initial;\">six titles got cut from the library</span>, including We Happy Few, The Anacrusis, Windjammers 2, Pupperazzi, Nobody Saves the World, and Danganronpa: Trigger Happy Havoc.</p><p style=\"outline: 0px; margin-right: 0px; margin-bottom: 1.3rem; margin-left: 0px; padding: 0px; font-size: 16px; font-family: -apple-system, \" .sfnstext-regular\",=\"\" \"system-ui\",=\"\" \"san=\"\" francisco\",=\"\" roboto,=\"\" \"segoe=\"\" ui\",=\"\" oxygen,=\"\" ubuntu,=\"\" cantarell,=\"\" \"fira=\"\" sans\",=\"\" \"droid=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" \"lucida=\"\" grande\",=\"\" sans-serif;\"=\"\">Game Pass has so far&nbsp;<span style=\"outline-color: initial; outline-style: initial;\">added three games in January 2023</span>, including Monster Hunter Rise, Persona 4 Golden, and Persona 3 Portable. As of January 24, Game Pass added three games and removed 10 so far this month, for a net reduction in the library of -7 games.</p><p style=\"outline: 0px; margin-right: 0px; margin-bottom: 1.3rem; margin-left: 0px; padding: 0px; font-size: 16px; font-family: -apple-system, \" .sfnstext-regular\",=\"\" \"system-ui\",=\"\" \"san=\"\" francisco\",=\"\" roboto,=\"\" \"segoe=\"\" ui\",=\"\" oxygen,=\"\" ubuntu,=\"\" cantarell,=\"\" \"fira=\"\" sans\",=\"\" \"droid=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" \"lucida=\"\" grande\",=\"\" sans-serif;\"=\"\"><br></p><div><br></div><div><br></div><div>\"Cheap Xbox Game Pass\" \"Discount Xbox Game Pass\" \"Affordable Xbox Game Pass\" \"Budget Xbox Game Pass\" \"Xbox Game Pass deals\" \"Xbox Game Pass sale\" \"Xbox Game Pass coupon\" \"Xbox Game Pass discount code\" \"Xbox Game Pass bundle\" \"Xbox Game Pass promo code\" \"Xbox Game Pass subscription discounts\" \"Xbox Game Pass cost saving\" \"Xbox Game Pass budget-friendly\" \"Xbox Game Pass subscription deals\"<br><span style=\"font-size: 16px;\">﻿</span></div>","8-4763454-xbox-game-pass-green-1269394.webp","2023-01-24 17:08:51","36","xbox-game-pass-is-losing-four-more-games-very-soon","1");




